import React from "react";
import Accordion from './Accordion'

const Faqs = (props) => {
  const { questions } = props;
  return (
    <div className="faqs">
      {questions.map((item) => {
        return (
          <Accordion title={item.question} content/>
        );
      })}
      <div>
        <img
          className="faqsimage"
          href="https://imgur.com/a/kV37dMu"
          alt="alt"
        />
      </div>
    </div>
  );
};

export default Faqs;
